// `;

export const Table = () => {
return (
    <>
    <table>
  <tr>
    <td>Name;</td>
    <td>Description</td>
    <td>Created at</td>
    <td>&nbsp;</td>
    <td>&nbsp;</td>
    <td>&nbsp;</td>
  </tr>
  <tr>
    <td>My first project</td>
    <td>Its only for testing</td>
    <td>about 1 month ago</td>
    <td><Button>Tasks</Button></td>
    <td><Button>Edit</Button></td>
    <td><Button>Destroy</Button></td>
  </tr>
  <tr>
  <td>My first project</td>
    <td>Its only for testing</td>
    <td>about 1 month ago</td>
    <td><Button>Tasks</Button></td>
    <td><Button>Edit</Button></td>
    <td><Button>Destroy</Button></td>
  </tr>
  <tr>
  <td>My first project</td>
    <td>Its only for testing</td>
    <td>about 1 month ago</td>
    <td><Button>Tasks</Button></td>
    <td><Button>Edit</Button></td>
    <td><Button>Destroy</Button></td>
  </tr>
</table>

    </>
)
}
